    @Test
    public void testDecode() throws IOException {
        String a = "6L+Z5piv5ZC0572u5pyN5Yqh";

        final BASE64Decoder base64Decoder = new BASE64Decoder();
        final byte[] bytes = base64Decoder.decodeBuffer(a);

        final String result = new String(bytes, StandardCharsets.UTF_8);
        System.out.println(result);

        System.out.println("---------------");

        String b = "这是后置服务";

        final BASE64Encoder base64Encoder = new BASE64Encoder();
        final String encode = base64Encoder.encode(b.getBytes(StandardCharsets.UTF_8));
        System.out.println(encode);

        System.out.println("对比结果: " + encode.equals(a));

    }

